import { Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from "@mui/material";
import React from "react";
import { useSelector } from "react-redux";
import SSPaper from "../../../components/common/other/SSPaper";
import { useNavigate } from "react-router-dom";
import { STUDENT_ROUTER } from "../../../shared/constants/router/student-router.constant";
import { useAppDispatch } from "../../../app/hooks";
import { deleteStudentEntitiesAsync, searchStudentEntitiesAsync } from "../../Students/redux/student.reducer";
import { isFulfilledAction } from "../../../shared/utils/reducer.utils";
import { toast } from "react-toastify";
import { Formik } from "formik";
import * as Yup from "yup";
import { findSvByMhEntitiesAsync } from "../redux/thongke.reducer";
import { THONGKE_ROUTER } from "../../../shared/constants/router/thongke-router.constant";
const Result = () => {
    const dispatch = useAppDispatch();

    const thongke = useSelector((state: any) => state.thongke.entities);

    const navigate = useNavigate();

    

    const initialValues = {
        id: "",
    };

    const validationSchema = Yup.object().shape({});

    const handleDelete = async (row: any, formik: any) => {
        
    };

    return (
        <div>
            {thongke == null ? null : (
                <Formik initialValues={initialValues} onSubmit={handleDelete} validationSchema={validationSchema}>
                    {(formik) => (
                        <SSPaper>
                            {thongke.length == 0 ? null : (
                                <div>
                                    <TableContainer>
                                        <Table sx={{ minWidth: 650 }} aria-label="simple table">
                                            <TableHead>
                                                <TableRow>
                                                    <TableCell sx={{ fontSize: "1rem" }}>STT</TableCell>
                                                    <TableCell sx={{ fontSize: "1rem" }}>Mã sinh viên</TableCell>
                                                    <TableCell sx={{ fontSize: "1rem" }}>Họ và tên</TableCell>
                                                    
                                                    <TableCell sx={{ fontSize: "1rem" }}>Điểm</TableCell>
                                                    
                                                    <TableCell sx={{ fontSize: "1rem" }}>Thao tác</TableCell>
                                                </TableRow>
                                            </TableHead>
                                            <TableBody>
                                                {thongke.map((row: any, index: number) => (
                                                    <TableRow
                                                        key={index}
                                                        sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                                                    >
                                                        <TableCell>{index + 1}</TableCell>
                                                        <TableCell>{row.id}</TableCell>
                                                        <TableCell>
                                                            {row.hoSv} {row.tenSv}
                                                        </TableCell>
                                                        
                                                        <TableCell>
                                                            
                                                            &nbsp;
                                                            <Button
                                                                variant="outlined"
                                                                size="small"
                                                                onClick={() => {
                                                                    handleDelete(row, formik);
                                                                }}
                                                            >
                                                                Delete
                                                            </Button>
                                                        </TableCell>
                                                    </TableRow>
                                                ))}
                                            </TableBody>
                                        </Table>
                                    </TableContainer>
                                </div>
                            )}
                        </SSPaper>
                    )}
                </Formik>
            )}
        </div>
    );
};

export default Result;
